import React from 'react'

import './css/Quote.scss'

const Quote = (props) => {
    return (
        <>
            <div id='quote'>
                <h4 id='quote_2'>'The ache for home lives in all of us, the safe place where we can go as we are and not questionned'</h4>
                <p id='author_P' className='p-medium'>know more</p>
            </div>
        </>
    )
}

export default Quote
